const Navbar = () => {
  return (
    <div>
      <nav class="navbar navbar-dark bg-dark">
        navbar
        <ul>
          <li>Home</li>
          <li>About</li>
        <li>Contact us</li>

        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
